import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import { Modal, Button, Form, Container, Navbar, Row, Col, Card } from 'react-bootstrap';

function PatientProfile() {
    const { id } = useParams();
    const [profile, setProfile] = useState({
        name: '',
        phone: '',
        email: '',
        address: '',
        gender: '',
    });
    const [showModal, setShowModal] = useState(false);

    useEffect(() => {
        const fetchProfile = async () => {
            try {
                const response = await axios.get(`/api/patients/${id}`);
                setProfile(response.data);
            } catch (error) {
                console.error('Error fetching patient profile:', error);
            }
        };

        fetchProfile();
    }, [id]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setProfile({
            ...profile,
            [name]: value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await axios.put(`/api/patients/${id}`, profile);
            alert('Profile updated successfully');
            setShowModal(false);
        } catch (error) {
            console.error('Error updating profile:', error);
        }
    };

    const handleShowModal = () => setShowModal(true);
    const handleCloseModal = () => setShowModal(false);

    return (
        <>
            {/* Navbar-like patient details at the top */}
            <Navbar bg="light" className="p-3 mb-4">
                <Container className="justify-content-between">
                    <Navbar.Brand>
                        <strong>Name:</strong> {profile.name} | <strong>Phone:</strong> {profile.phone} | <strong>Email:</strong> {profile.email}
                    </Navbar.Brand>
                    <Button variant="primary" onClick={handleShowModal}>
                        Update Profile
                    </Button>
                </Container>
            </Navbar>

            <Container>
                <Row className="justify-content-center">
                    <Col md={8}>
                        <Card className="mt-4">
                            <Card.Body>
                                <h4 className="text-center mb-4">Patient Details</h4>
                                <p><strong>Address:</strong> {profile.address}</p>
                                <p><strong>Gender:</strong> {profile.gender}</p>
                            </Card.Body>
                        </Card>
                    </Col>
                </Row>
            </Container>

            {/* Modal for updating profile */}
            <Modal show={showModal} onHide={handleCloseModal}>
                <Modal.Header closeButton>
                    <Modal.Title>Update Profile</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Form onSubmit={handleSubmit}>
                        <Form.Group controlId="formName">
                            <Form.Label>Name</Form.Label>
                            <Form.Control
                                type="text"
                                name="name"
                                value={profile.name}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Form.Group controlId="formPhone">
                            <Form.Label>Phone</Form.Label>
                            <Form.Control
                                type="text"
                                name="phone"
                                value={profile.phone}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Form.Group controlId="formEmail">
                            <Form.Label>Email</Form.Label>
                            <Form.Control
                                type="email"
                                name="email"
                                value={profile.email}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Form.Group controlId="formAddress">
                            <Form.Label>Address</Form.Label>
                            <Form.Control
                                type="text"
                                name="address"
                                value={profile.address}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Form.Group controlId="formGender">
                            <Form.Label>Gender</Form.Label>
                            <Form.Control
                                type="text"
                                name="gender"
                                value={profile.gender}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Button variant="primary" type="submit" className="mt-3">
                            Save Changes
                        </Button>
                    </Form>
                </Modal.Body>
            </Modal>
        </>
    );
}

export default PatientProfile;
